--
-- Table structure for table `test_cases`
--

DROP TABLE IF EXISTS `test_cases`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `test_cases` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `test_id` int(10) unsigned NOT NULL COMMENT '案例对应的实验id',
  `school_id` int(10) unsigned NOT NULL COMMENT '案例实验所有学校id，不同的学校可能授权相同的实验',
  `type` int(10) unsigned NOT NULL COMMENT '案例类型，0=运营创建的实验案例，1=教师的实验案例，2=学生的实验案例',
  `user_id` int(10) unsigned NOT NULL COMMENT '创建类型的用户id，可能是运营，教师或学生',
  `title` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '案例的产品标题',
  `desc` text COLLATE utf8_unicode_ci NOT NULL COMMENT '案例的产品详细描述',
  `price` double(8,2) NOT NULL COMMENT '零售价，具体价格还会根据规格变动。',
  `stock` int(10) unsigned NOT NULL COMMENT '库存，具体数量会根据规格变动。',
  `data` longtext COLLATE utf8_unicode_ci NOT NULL COMMENT '实验案例的数据，以JSON格式保存，因为不能平台需要填写的字段不同。',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `course_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '实验案例对应的课程id',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '实验案例状态，1=进行中，2=已提交',
  `attr_num` int(11) DEFAULT '0' COMMENT '属性评分字段数量',
  PRIMARY KEY (`id`),
  KEY `test_cases_test_id_index` (`test_id`),
  KEY `test_cases_school_id_index` (`school_id`),
  KEY `test_cases_type_index` (`type`),
  KEY `test_cases_user_id_foreign` (`user_id`),
  CONSTRAINT `test_cases_test_id_foreign` FOREIGN KEY (`test_id`) REFERENCES `tests` (`id`),
  CONSTRAINT `test_cases_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=458 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT COMMENT='实验案例表(包含运营，教师，学生完成的所有实验)';
/*!40101 SET character_set_client = @saved_cs_client */;

